import HappinessView from "./components/pages/HappinessView.vue";
import NaverView from "./components/pages/NaverView.vue";
import PincetteView from "./components/pages/PincetteView.vue";
import ProfileView from "./components/pages/ProfileView.vue";
import PyautoguiView from "./components/pages/PyautoguiView.vue";

export default {
  pyautogui: {
    title: "얼굴 인식과 Pyautogui 마우스 제어 기반의 비접촉식 입력 기법",
    tags: ["Opencv", "Pyautogui", "Mediapipe", "Python"],
    path: "/pyautogui",
    component: PyautoguiView,
  },
  pincette: {
    title: "이미지 크롤링 및 전처리 자동화",
    tags: ["Selenium", "Pillow", "Python"],
    path: "/pincette",
    component: PincetteView,
  },
  profile: {
    title: "개인 소개 페이지 (현재)",
    tags: ["Vue.js", "Tailwindcss", "HTML5", "CSS3"],
    path: "/profile",
    component: ProfileView,
  },
  naverBlog: {
    title: "프로그래밍 지식 공유",
    tags: ["Naver Blog"],
    path: "/naverBlog",
    component: NaverView,
  },
  happiness: {
    title: "헹복지수 데이터 분석",
    tags: ["Numpy", "Pandas", "Matplotlib", "Sklearn"],
    path: "/happiness",
    component: HappinessView,
  },
};
